%pyspark
import numpy as np
import pandas as pd
from pyspark.sql.types import *
from pyspark.sql import functions 

def GetTabbedTableFrom2D(data):
    output = None

    for row in data:
    	rowOut = None
    	for col in row:		
    		if rowOut is None:
    			rowOut = str(col)
    		else:
    			rowOut = rowOut + '\t' + str(col)
    	if output is None:
    		output = rowOut
    	else:
    		output = output + '\n' + rowOut
    return output
